import React from 'react';
import useNavigate from 'react-router-dom';

import './App.css';
/**
 * Simple component with no state.
 *
 * See the basic-react example for an example of adding and reacting to
 * changes in state and lecture 10 for details on Material-UI
 *
 * @return {object} JSX
 */
export default function HomeScreen() {
  const navigate = useNavigate();
  return (
    <div>
      <h1 className='title'>AKALAT</h1>
      <button className='button1'>Suggestions</button>
      <button className='button2'>Cuisine</button>
      <button className='button3'>Ingredients</button>
    </div>
  );
}
